def solve(A):
        rows = len(A)
        col = len(A[0])

        C_Mat = [[0 for i in range(col)] for j in range(rows)]
        zero_row = []
        zero_col = []

        for r in range(rows):
            for c in range(col):
                if A[r][c] == 0:
                    zero_row.append(r)
                    zero_col.append(c)
        for r in range(rows):
            for c in range(col):
                if A[r][c]!= 0 and r not in zero_row and c not in zero_col:
                    C_Mat[r][c] = A[r][c]


        return C_Mat
print(solve(A))

def solve2(A):
        rows = len(A)
        col = len(A[0])
        C_Mat = [[0 for i in range(col)] for j in range(rows)]
        for r in range(rows):
            for c in range(col):
                if A[r][c] == 0:
                    break
                else:
                    C_Mat[r][c] = A[r][c]
            if A[r][c] == 0:
                break
        return C_Mat


def rethink(A):
    rows = len(A)
    col = len(A[0])
    col_lst = []
    for i in range(rows):
        if 0 in A[i]:
            for c in range(col):
                if A[i][c] ==0:
                    col_lst.append(c)
            A[i] = [0]* col
        
    for r in range(rows):
        for c in col_lst:
            A[r][c] = 0
        
    
    return A


print(rethink(A))
